import dados from '../dados/dadosClientes.json';
import '../design/lista.css';

var dad = [];
var a = ' ';
async function returnDados() {
  const url = "http://localhost:3001/dados";
  fetch(url)
  .then(response => response.json())
  .then(dados => {
      a = dados.length
      dados.map((elem) => (console.log(elem),dad.push(elem)))
  })
};
const dado = returnDados();
function ee() {
   console.log('foi')
   if(console.log(dad.length == a)) {
      return (dad.map((items) => (<div className="ficha"><p className="p">Nome do Cliente: </p><p className="p">{items.userclientes}</p><p className="p">Identificação do Cliente: </p><p className="p">{items.usinaid}</p><p className="p">Participação na Usina: </p><p className="p">{items.perctparticipacao}</p><button className="apagaCliente">🗑️</button></div>)))
   }
}
function lista() {
   return (
      <div className="appLista">
         <header className="appBarLista">
            <ul className="listLista">
               <li className="elemlistLista"><a href="/">Graficos</a></li>
               <li className="elemlistLista" id="elemlistListaDois"><a href="/cliente">Cadastrar Novos Usuarios</a></li>
               <li className="elemlistLista"><a href="/lucros">Lucros</a></li>/
            </ul>
         </header>
         <main className="mainLista">
            <div className="lista">
               {ee()}
            </div>
         </main>
      </div>
   )
}
export default lista;
